import React from 'react';
import './form-input.styles.css';

const FormInput = ({ handleChange, label, ...otherFormProps }) => {
    console.log({...otherFormProps})
    return (
        <div className="group">
            <div className="form-input" onChange={handleChange} {...otherFormProps}>
                {label ?
                    (<label className={`${otherFormProps.value.length ? 'shrink' : ''} form-group-label`}>
                        {label}
                    </label>)
                    : null
                }
            </div>
        </div>
    )
}

export default FormInput;
